var title_f41_30_42469="Allergen sensitization";
var content_f41_30_42469=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F55328&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F55328&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 504px\">",
"   <div class=\"ttl\">",
"    Allergen-specific IgE production and dissemination",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 484px; height: 712px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Allergens (in this figure, aeroallergens)&nbsp;enter the tonsils, within which they are taken up and degraded by antigen presenting cells (APC). APCs then&nbsp;interact with T helper cells type 2&nbsp;(TH2) cells and B cells in the lymph nodes, leading to allergen-specific IgE production. The IgE&nbsp;enters the blood stream, and then diffuses&nbsp;through tissues (especially the skin and&nbsp;mucosal tissues of the respiratory and&nbsp;gastrointestinal tracts).&nbsp;The IgE&nbsp;binds to high affinity Fc receptors (FcepsilonRI) on the surface of the tissue mast cells and circulating basophils. When these IgE-coated cells encounter that specific aeroallergen subsequently, they become activated, leading to the release of inflammatory mediators, which result in the signs and symptoms of IgE-mediated allergic reactions.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
