" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Overview of soft tissue rheumatic disorders",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
