" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Spinal column injuries in adults: Definitions, mechanisms, and radiographs",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?41/30/42473/contributors\">",
