var title_f41_30_42476="ARV class adverse reactions II";
var content_f41_30_42476=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F77005&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F77005&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antiretroviral agents, class adversereactions - II",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Reaction",
"       </td>",
"       <td class=\"subtitle1\">",
"        Fat redistribution",
"       </td>",
"       <td class=\"subtitle1\">",
"        Hyperlipidemia",
"       </td>",
"       <td class=\"subtitle1\">",
"        Rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Frequency",
"       </td>",
"       <td>",
"        4 to 50 percent",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        NNRTI: 8 to 16 percent",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Agents",
"       </td>",
"       <td>",
"        <p>",
"         Fat accumulation: PIs",
"        </p>",
"        <p>",
"         Lipoatrophy: NRTIs d4T&gt;ddI&gt;AZT. Also occurs without antiretrovirals.",
"        </p>",
"       </td>",
"       <td>",
"        PI",
"       </td>",
"       <td>",
"        <p>",
"         NNRTI - NVP &gt;EFV and DLV",
"        </p>",
"        <p>",
"         PIs - increased risk with sulfonamide allergy",
"        </p>",
"        <p>",
"         NRTI - ABC*",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Risk",
"       </td>",
"       <td>",
"        No clear risks defined",
"       </td>",
"       <td>",
"        Risk for DVC - HBP, diet, obesity, genes, prior MI/stroke, diabetes, age",
"       </td>",
"       <td>",
"        <p>",
"         NNRTI - 1st 12 wks",
"        </p>",
"        <p>",
"         Female",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Sx",
"       </td>",
"       <td>",
"        <p>",
"         Fat accumulation - abd (visceral), buffalo hump, breasts, lipomas",
"        </p>",
"        <p>",
"         Fat atrophy - extremities buttocks, face",
"        </p>",
"       </td>",
"       <td>",
"        Cardiovascular disease with stroke or MI",
"       </td>",
"       <td>",
"        <p>",
"         Common - red rash",
"        </p>",
"        <p>",
"         Severe - Stevens-Johnson synd, TEN, DRESS (Drug Rash, Eosinophilia, and Systemic Systems)*",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Lab",
"       </td>",
"       <td>",
"        <p>",
"         CT scan, MRI, Waist: Hip, Bioelectric",
"        </p>",
"        <p>",
"         Impedence, DEXA, Ultrasound",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; triglycerides",
"        </p>",
"        <p>",
"         &uarr; cholesterol, and LDL cholesterol",
"        </p>",
"       </td>",
"       <td>",
"        Eosinophilia - variable",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Treatment",
"       </td>",
"       <td>",
"        <p>",
"         Plastic surgery (but expensive)",
"        </p>",
"        <p>",
"         Exercise?",
"        </p>",
"        <p>",
"         Change PI to NNRTI?",
"        </p>",
"        <p>",
"         Lipoatrophy- d/c d4T, ddI or AZT",
"        </p>",
"       </td>",
"       <td class=\"sublist1_start\">",
"        <p>",
"         NECP guidelines:",
"        </p>",
"        <p>",
"         - General: diet and exercise",
"        </p>",
"        <p>",
"         - LDL cholesterol &uarr;: Pravastatin or atorvastatin",
"        </p>",
"        <p>",
"         - Triglycerides &uarr;: Gemfibrozil or fenofibrate",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Most rashes do not require drug discontinuation",
"        </p>",
"        <p>",
"         Withdraw NNRTI if severe; may tolerate other NNRTI (NVP &rarr; EFV)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Monitor",
"       </td>",
"       <td>",
"        Appearance",
"       </td>",
"       <td>",
"        Fasting lipid profile at baseline, at 3 to 6 months post HAART initiation, then yearly. More frequently if high risk or treated.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * DRESS: Life threatening complication that is seen with NVP and ABC - usually in the first 6 weeks of therapy.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Bartlett, JG. Pocket Guide; Adult HIV/AIDS Treatment, November 2003.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
